import Expenses from "./components/Expenses";
import ExpenseItem from "./components/Expenses";

function App() {

  // Array of expenses
  const expensesList = [
    {id: 'e1', title: 'Toilet Paper', amount: 94.12, date: new Date(2020, 7, 14)},
    {id: 'e2', title: 'TV', amount: 436.16, date: new Date(2021, 3, 13)},
    {id: 'e3', title: 'Car', amount: 4330.00, date: new Date(2021, 4, 10)},
    {id: 'e4', title: 'Food', amount: 326.03, date: new Date(2022, 6, 12)},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses expenses={expensesList}/>
    </div>
  );
}

export default App;
